let StoreButton={
    buttons:
    [{num:'1'},{num:'2'},{num:'3'},{num:'4'},{num:'5'},{num:'6'},{num:'7'},{num:'8'},{num:'9'},
        {num:'0'}, {num:'+'}, {num:'-'}, {num:'/'}, {num:'*'}
        ],
    operation:[
        {num:'='}, {num:'CE'}, {num:'C'}
    ]
}
export default StoreButton;
